import math

def max_gcd_of_subarray_sums(arr: List[int], K: int) -> int:
    N = len(arr)
    total_sum = sum(arr)
    divisors = []
    m = int(total_sum ** 0.5)
    for i in range(1, m + 1):
        if total_sum % i == 0:
            divisors.append(i)
            if i != total_sum // i:
                divisors.append(total_sum // i)
    divisors.sort(reverse=True)
    prefix_sum = arr[:]
    for i in range(1, N):
        prefix_sum[i] -= prefix_sum[i - 1]
    for x in divisors:
        count = 0
        for y in prefix_sum:
            if y % x == 0:
                count += 1
        if count >= K:
            return x
    return 1

